import React from 'react';

const CarImage = ({ imageUrl = 'https://dashboard.codeparrot.ai/api/image/Z7O5HTO_YEiK21yL/car-2-1.png', altText = 'Car' }) => {
  return (
    <div style={{
      width: '100%',
      maxWidth: '1048px',
      minWidth: '320px',
      height: 'auto',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      overflow: 'hidden',
      padding: '20px'
    }}>
      <img
        src={imageUrl}
        alt={altText}
        style={{
          width: '100%',
          height: 'auto',
          maxHeight: '537px',
          objectFit: 'cover',
          transition: 'transform 0.3s ease-in-out'
        }}
        onMouseOver={(e) => {
          e.currentTarget.style.transform = 'scale(1.02)';
        }}
        onMouseOut={(e) => {
          e.currentTarget.style.transform = 'scale(1)';
        }}
      />
    </div>
  );
};

export default CarImage;
